import React from "react";
import "./features.css";

const Features = ({ title, text }) => {
    return (
        <div className="gpt3__features-container_feature">
            <div className="gpty3__features-container__features-tittle">
                <h>{title}</h>
            </div>
            <div>{text}</div>
        </div>
    );
};

export default Features;
